  GeoTIFF Image Showing the Combined 4-m Multibeam and LIDAR Bathymetry Generated
  from National Oceanic and Atmospheric Administration (NOAA) Surveys H11442 and H11225
  Offshore of Niantic, CT (NIANTIC_MBLIDAR_GEO.TIF, Geographic, WGS84)\",\n\t\"tracking_summary\":
